import React from 'react';

function Objetivo() {
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h2>Objetivo</h2>
      <p>Nosso objetivo é compartilhar conhecimento sobre a história através de vídeos e conteúdos interativos.</p>
    </div>
  );
}

export default Objetivo;
